queries.callback:
_.chain(context)
.uniq(function(x) {
return x.reg
})
.map(function(place){
return {
data_value:place.reg,
display:{title: {text: place.regname} } };
}).value()

_.map(context, function(place){place.data_value = place.cscode;
place.display = {title: {text: place.csname} };
return place;
})

